Here's a JavaScript function that switches the order of adjectives in a sentence:

```js
function switchAdjectives(sentence) {
  // Split the sentence into an array of words
  const words = sentence.split(" ");

  // Find the index of the first adjective (a word that comes before a noun and ends with 'e' or 'y')
  let firstAdjIndex = -1;
  for (let I = 0; I < words.length; i++) {
    const lastChar = words[i].slice(-1);
    const isBeforeNoun = words[i + 1].indexOf(" ") === words[i].lastIndexOf(" ");
    if (lastChar === "e" || lastChar === "y" && isBeforeNoun) {
      firstAdjIndex = i;
      break;
    }
  }

  // If we couldn't find any adjectives, return the original sentence
  if (firstAdjIndex === -1) {
    return sentence;
  }

  // Swap the positions of the first and second adjectives
  [words[firstAdjIndex], words[firstAdjIndex + 1]] = [words[firstAdjIndex + 1], words[firstAdjIndex]];

  // Join the words back into a sentence
  return words.join(" ");
}

// Example usage:
const sentence = "Beautiful green trees are in the park";
const result = switchAdjectives(sentence);
console.log(result); // Output: "Green beautiful trees are in the park"
```

