function getNestedValues(object, keyPath) {
  let currentObject = object;
  const keys = keyPath.split('.');
  const results = [];

  for (let I = 0; I < keys.length; i++) {
    const key = keys[i];
    if (!currentObject.hasOwnProperty(key)) {
      return results; // Stop iterating if any key is missing
    }

    if (i === keys.length - 1) {
      results.push(currentObject[key]);
    } else {
      currentObject = currentObject[key];
    }
  }

  return results;
}

