private string GetUsernameFromJwt(string authorizationHeader)
{
    var authHeader = AuthorizationHeader.Split(" ");
    if (!authHeader[0].Equals("Bearer", StringComparison.OrdinalIgnoreCase))
    {
        throw new UnauthorizedAccessException();
    }
    using (var stream = Convert.FromBase64String(authHeader[1]))
