3. In this method, we first split the authorization header into two parts - "Bearer" and the actual JWT token. We then decode the JWT token using `Convert.FromBase64String()`, and read its payload using `StreamReader`. The `sub` claim (short for subject) is where we store the username or email address of the user. Finally, we return the username extracted from the JWT token.

