Inner functions, also known as nested functions or local functions, are functions defined within another function in JavaScript. They have access to the parent function's scope and variables but cannot be called directly from outside the parent function. Inner functions can help with modularity and readability by encapsulating logic and reducing code duplication.

Outer functions, on the other hand, are functions that contain one or more inner functions. They can be called independently and do not necessarily rely on their inner functions. Outer functions provide a way to define and organize multiple related functions together.

Here's an example:

```javascript
function calculateArea(radius) {
  function getCircumference() {
    return 2 * Math.PI * radius;
  }

  return Math.PI * radius * radius;
}

// Calling the outer function
console.log(calculateArea(5));

// Accessing the inner function (within the context of the outer function)
console.log(calculateArea(5).getCircumference());

// Trying to access the inner function outside the outer function will result in a reference error
// console.log(getCircumference()); // ReferenceError: getCircumference is not defined
```

In this example, `calculateArea` is the outer function, and `getCircumference` is the inner function. The `getCircumference` function calculates the circumference of a circle based on its radius, while the `calculateArea` function calculates the area of a circle using the same radius. By nesting the `getCircumference` function inside `calculateArea`, we avoid repetition and make the code more organized and easier to understand. Additionally, we can access the inner function within the context of the outer function using the dot notation (`.`) followed by the inner function name.

