```scala
import scala.util.{Failure, Success, Try}

def extractLocation(message: String): Option[String] = {
  val pattern = raw"(Paris|London|New York|[A-Z][a-zA-Z]+)".r
  val matches = pattern.findAllMatchIn(message)
  matches.headOption.map(_.group(0))
}

def extractDateRange(message: String): Option[(LocalDate, LocalDate)] = {
  val pattern = raw"(\d{1,2}\/\d{1,2}\/\d{4}|[A-Z][a-z]{3}\s\d{1,2},\s\d{4})".r
  val matches = pattern.findAllMatchIn(message)
  val dateStrings = matches.flatMap(match => match.groups.values.map(group => group.group(0)))
  Try(valFromStr(dateStrings(0)) -> valFromStr(dateStrings(1))).toOption.filter(_._1 <= _._2)
}

def valFromStr(str: String): LocalDate = DateTimeFormatter.ofPattern("M/d/yyyy").parse(str, LocalDate::from)
```
These functions extract the location and date range from the user's message using regular expressions and convert them into `LocalDate` objects using the `java.time` library. The `extractDateRange` function also checks that the end date is after the start date.

